import React from "react";
import TotalCard from "./TotalCard/TotalCard";
import GenCards from "./GenCards/GenCards";
import "./OverviewSection.css";

function OverviewSection() {
  const mode="cors";

  fetch('https://leetcode.com/graphql?query={%20matchedUser(username:%20%22tush27%22)%20{%20username%20submitStats:%20submitStatsGlobal%20{%20acSubmissionNum%20{%20difficulty%20count%20submissions%20}%20}%20}%20}',
    mode
  ).then((response)=>{
    if(!response.ok)
    throw new Error()
  });

    return (
    <div className="overview">
      <TotalCard />
      <GenCards props={{ title: "Easy", que: "100", imgUrl: "#" }} />
      <GenCards props={{ title: "Medium", que: "200", imgUrl: "#" }} />
      <GenCards props={{ title: "Hard", que: "300", imgUrl: "#" }} />
    </div>
  );
}

export default OverviewSection;
